    //透明层
    PopupManager.prototype.opacityBg = function () {
        var opacity = new Laya.Sprite();
        opacity.x = 0;
        opacity.y = 0;
        opacity.width = Laya.stage.width;
        opacity.height = Laya.stage.height;
        var graphics = new Laya.Graphics();
        graphics.clear();
        graphics.save();
        graphics.alpha(0.6);
        graphics.drawRect(0, 0, this.width, this.height, '#000000');
        graphics.restore();
        opacity.graphics = graphics;
        opacity.on(Laya.Event.CLICK, this, function () {
            return false;
        });
        this.addChild(opacity);
        return opacity;
    };
