    //领取逻辑
    PopupManager.prototype.getGiftCode = function (name, num, target) {
        var btnGroup = target.btnGroup;
        var scX = Laya.Browser.window.scX;
        if (name == 'gcz') { //锤子
            var boxSp = btnGroup.getChildAt(0); //锤子的盒子
            //创建道具
            var goX = btnGroup.x + boxSp.x;
            var goY = btnGroup.y + boxSp.y;
            this.getPropAnim(boxSp, goX, goY, num, scX);
            config_1.default.prop['cz'] += num;
        }
        else if (name == 'glx') {
            var boxSp = btnGroup.getChildAt(3); //流星的盒子
            var goX = btnGroup.x + boxSp.x;
            var goY = btnGroup.y + boxSp.y;
            this.getPropAnim(boxSp, goX, goY, num, scX);
            config_1.default.prop['bomb'] += num;
        }
        else if (name == 'greset') {
            var boxSp = btnGroup.getChildAt(2); //重置的盒子
            var goX = btnGroup.x + boxSp.x;
            var goY = btnGroup.y + boxSp.y;
            this.getPropAnim(boxSp, goX, goY, num, scX);
            config_1.default.prop['resetImg'] += num;
        }
        else if (name == 'gsz') {
            var boxSp = btnGroup.getChildAt(1); //刷子的盒子
            var goX = btnGroup.x + boxSp.x;
            var goY = btnGroup.y + boxSp.y;
            this.getPropAnim(boxSp, goX, goY, num, scX);
            config_1.default.prop['pen'] += num;
        }
    };
    //处理领取道具动画
    PopupManager.prototype.getPropAnim = function (target, x, y, num, scX) {
        var propImg = this.getImage("main/" + target.name + ".png", 95 * scX, 94 * scX, (Laya.stage.width - 95 * scX) / 2, (Laya.stage.height - 94 * scX) / 2);
        propImg.zOrder = 3;
        //搞一个动画，飞到指定位置
        Laya.Tween.to(propImg, {
            x: x, y: y, scX: .5, scY: .5, alpha: .3, update: Laya.Handler.create(this, function (e) {
            })
        }, 1500, Laya.Ease.circInOut, Laya.Handler.create(this, function (e) {
            Laya.stage.removeChild(propImg);
            target.nums += num;
            var txt = target.getChildByName('oText').getChildAt(1);
            if (txt != null) {
                target.getChildByName('oText').visible = true;
                txt.text = target.nums;
            }
            target.getChildByName('oHaveImg').visible = false;
        }), 0);
        Laya.stage.addChild(propImg);
    };
